import React, { useState } from 'react';

function Register() {
  // State to store input values
  const [formData, setFormData] = useState({
    username: '',
    password: '',
    displayName: '',
    email: '',
    phone: ''
  });

  // State to toggle password visibility
    const [passwordShown, setPasswordShown] = useState(false);

  // Toggle password visibility
    const togglePasswordVisibility = () => {
      setPasswordShown(!passwordShown);
    };

  // Handle input change
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  // State for managing popup visibility and message
  const [popupSuccessfullyRegistered, setPopup] = useState({ show: false, message: '' });
  // Handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();
        if (!error) {
            console.log("Submitting new ad", formData);

            const formDataObj = new FormData();
            formDataObj.append('category', formData.category);
            formDataObj.append('petName', formData.petName);
            formDataObj.append('petAge', formData.petAge);
            formDataObj.append('petGender', formData.petGender);
            formDataObj.append('adContent', formData.adContent);
            if (formData.image) {
                formDataObj.append('image', formData.image);
            }
            try {
                const response = await fetch('http://localhost:8080/api/register', {
                    method: 'POST',
                    body: formDataObj,
                    // Headers are not set with 'Content-Type': 'multipart/form-data' here,
                    // because the browser will automatically set it correctly based on the FormData object,
                    // including the boundary string required for multipart forms.
                });

                if (response.ok) {
                    const responseBody = await response.text();
                    console.log('Ad was created successfully, response:', responseBody);
                    setPopup({ show: true, message: 'Ad was created successfully' });
                } else {
                    throw new Error('Failed to create ad');
                }
            } catch (error) {
                console.error('Error during ad creation:', error);
                setPopup({ show: true, message: 'Failed to create ad' });
            } finally {
                setTimeout(() => {
                    setPopup({ show: false, message: '' });
                }, 3000); // 3000 ms = 3 seconds
            }
        }
    };

  return (
    <form onSubmit={handleSubmit}>
      <h2>Register</h2>
      <label>
        Username:
        <input type="text" name="username" value={formData.username} onChange={handleChange} required />
      </label>
      <br />
      <label>
        Password:
        <input type={passwordShown ? "text" : "password"} name="password" value={formData.password} onChange={handleChange} required />
            <button type="button" onClick={togglePasswordVisibility}>
                {passwordShown ? "Hide" : "Show"}
            </button>
      </label>
      <br />
      <label>
        Display Name:
        <input type="text" name="displayName" value={formData.displayName} onChange={handleChange} required />
      </label>
      <br />
      <label>
        Email:
        <input type="email" name="email" value={formData.email} onChange={handleChange} required />
      </label>
      <br />
      <label>
        Phone:
        <input type="tel" name="phone" value={formData.phone} onChange={handleChange} required />
      </label>
      <br />
      {popupSuccessfullyRegistered.show && (
              <div style={{
                position: 'absolute',
                top: '20%', // Adjust positioning as needed
                left: '50%',
                transform: 'translate(-50%, -50%)',
                backgroundColor: '#f8f9fa',
                padding: '20px',
                borderRadius: '5px',
                boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)'
              }}>
                {popupSuccessfullyRegistered.message}
              </div>
      )}
      <button type="submit">Submit</button>
    </form>
  );
}

export default Register;
